import React from "react";
import { useNavigate } from "react-router-dom";

function CaseThumbnails(props) {

  let navigate = useNavigate();

  if(props.project === undefined){
    return (
      <div className="caseStudies">
        <div id="jclogo" className="card" onClick={()=>{navigate("/work/JasonClerkID")}}></div>
        <div id="sflogo" className="card" onClick={()=>{navigate("/work/SugarFlower")}}></div>
        <div id="canada150logos" className="card" onClick={()=>{navigate("/work/Canada150")}}></div>
        <div id="McDslogo" className="card" onClick={()=>{navigate("/work/McDonaldsGCTA")}}></div>
      </div>
    );
  }
  else if(props.project.URLquery === "JasonClerkID"){
    return (
      <div className="caseStudies">
        <div id="jclogoSelected" className="card" onClick={()=>{navigate("/work/JasonClerkID")}}></div>
        <div id="sflogo" className="card" onClick={()=>{navigate("/work/SugarFlower")}}></div>
        <div id="canada150logos" className="card" onClick={()=>{navigate("/work/Canada150")}}></div>
        <div id="McDslogo" className="card" onClick={()=>{navigate("/work/McDonaldsGCTA")}}></div>
      </div>
    );
  }
  else if(props.project.URLquery === "SugarFlower"){
    return (
      <div className="caseStudies">
        <div id="jclogo" className="card" onClick={()=>{navigate("/work/JasonClerkID")}}></div>
        <div id="sflogoSelected" className="card" onClick={()=>{navigate("/work/SugarFlower")}}></div>
        <div id="canada150logos" className="card" onClick={()=>{navigate("/work/Canada150")}}></div>
        <div id="McDslogo" className="card" onClick={()=>{navigate("/work/McDonaldsGCTA")}}></div>
      </div>
    );
  }
  else if(props.project.URLquery === "Canada150"){
    return (
      <div className="caseStudies">
        <div id="jclogo" className="card" onClick={()=>{navigate("/work/JasonClerkID")}}></div>
        <div id="sflogo" className="card" onClick={()=>{navigate("/work/SugarFlower")}}></div>
        <div id="canada150logosSelected" className="card" onClick={()=>{navigate("/work/Canada150")}}></div>
        <div id="McDslogo" className="card" onClick={()=>{navigate("/work/McDonaldsGCTA")}}></div>
      </div>
    );
  }
  else if(props.project.URLquery === "McDonaldsGCTA"){
    return (
      <div className="caseStudies">
        <div id="jclogo" className="card" onClick={()=>{navigate("/work/JasonClerkID")}}></div>
        <div id="sflogo" className="card" onClick={()=>{navigate("/work/SugarFlower")}}></div>
        <div id="canada150logos" className="card" onClick={()=>{navigate("/work/Canada150")}}></div>
        <div id="McDslogoSelected" className="card" onClick={()=>{navigate("/work/McDonaldsGCTA")}}></div>
      </div>
    );
  }
  else 
    return (
      <div className="caseStudies">
        <div id="jclogo" className="card" onClick={()=>{navigate("/work/JasonClerkID")}}></div>
        <div id="sflogo" className="card" onClick={()=>{navigate("/work/SugarFlower")}}></div>
        <div id="canada150logos" className="card" onClick={()=>{navigate("/work/Canada150")}}></div>
        <div id="McDslogo" className="card" onClick={()=>{navigate("/work/McDonaldsGCTA")}}></div>
      </div>
    );
  }

  export default CaseThumbnails;
